  \"Oceanographic profile data collected from CTD and sound velocimeter - moving vessel
  profiler casts aboard NOAA Ship Rainier Launches as part of project OPR-N305-RA-14
  in the Coastal Waters of SE Alaska from 2014-10-29 to 2014-11-17 (NCEI Accession
  0130656)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-02-26T22:14:42.060133\",\n\t\"name\":
  \"oceanographic-profile-data-collected-from-ctd-and-sound-velocimeter-moving-vessel-profiler\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130656 includes physical
  and profile data collected aboard NOAA Ship Rainier Launches during project OPR-N305-RA-14
  in the Coastal Waters of SE Alaska from 2014-10-29 to 2014-11-17. These data include
  CONDUCTIVITY, HYDROSTATIC PRESSURE, SALINITY, SOUND VELOCITY, WATER DENSITY and
  WATER TEMPERATURE. The instruments used to collect these data include CTD and sound
  velocimeter - moving vessel profiler. These data were collected and submitted by
